import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import App from './components/app/App';

const root = ReactDOM.createRoot(document.getElementById('App'));

root.render(
  <React.StrictMode>
    <App defaultSize={16} />
  </React.StrictMode>
);
